import React from 'react';
import './Logo.css';
import logoImage from '../assets/logo.jpeg';

const Logo = () => {
  return (
    <div className="logo-container">
      <img src={logoImage} alt="Vaahan Bazaar Logo" className="logo-image" />
    </div>
  );
};

export default Logo;
